import React, { Component } from 'react'
import {Paper, Container, Box , TextField} from '@material-ui/core'

export default class Login extends Component {
    render() {
        return (
            <Container>
                <Box>
                   <Paper  className="col-5 mt-5 offset-3 justify-content-center " elevation={3}>
                       <h2 className="text-center">LOGIN </h2>
                   <form className="mt-3" noValidate autoComplete="off">
  <TextField id="standard-basic" label="Enter your Username" >USERNAME</TextField>
  <TextField id="standard-basic" label="Enter your Password" >PASSWORD</TextField>
</form>
                   </Paper>
                </Box>
            </Container>
        )
    }
}
